import React from 'react';
import {Link} from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
const NavBar = () => (
    <Nav>
        <Nav.Link href="/">Home</Nav.Link>
    </Nav>


);
export default NavBar;

